  Code = "class Solution:\n    def duplicateNumbersXOR(self, nums: List[int]) -> int:\n        freqs = [0] * 51\n        res = 0\n        for i in range(len(nums)):\n            freqs[nums[i]] += 1\n            if freqs[nums[i]] == 2:\n                res ^= nums[i]\n        return res"
